import React from 'react';
// import SignUp from './SignUp';
// import Home from './Homs';
// import Login from './Login';
// import { Route, Routes } from 'react-router-dom';
// import About from './Aboute';
// import Dashboard from './Dashboerd';
// import Users from './Users';




function App(props){
return(
<div style={{textAlign}}>
    <h3>Hello Your Name is {props.name}</h3>
    <h5>Your Age is {props.age}</h5>
    <p>Your Title is {props.title}</p>
</div>
)

}
export default App
    
